        <div className="App__Form">
          <div className="PageSwitcher">
            <a href="#" className="PageSwitcher__Item ">Sign In</a>
            <a href="#" className="PageSwitcher__Item PageSwitcher__Item--Active">Sgin Up</a>
          </div>

          <div className="FormTitle">
            <a href="#" className="FormTitle__Link">Sgin In</a> or <a href="#" 
            className="FormTitle__Link FormTitle__Link--Active">Sgin Up</a>
          </div>

          <div className="FormCenter">

          </div>

        </div>
      </div>
    )
  }

}

export default App;
